import React from 'react';
import axios from 'axios';

axios.get('http://localhost:8080/device_summary', {
        headers: {
            'Access-Control-Allow-Origin': '*',
        },
        proxy: {
            host: '104.236.174.88',
            port: 3128
        },
    }
    .then(res => {
        console.log(res.data);
    })
    .catch(error => {
        console.log(error);
    })
)

export default class App extends React.Component {

    render() {
        return ("he");
    }
}
